import React from "react";

class Floors extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            floors: 5
        };
    }

    componentDidMount = () => {
    };


    render() {
        var floorDetails = [];
        for (var i = 0; i < this.state.floors; i++) {
            floorDetails.push(
            <div className="floorBlock">
            <div className="floorNum">{i}</div>
            </div>
            );   
        }

        return (
            <div className="floorsWrapper">
                {floorDetails}
            </div>
        );
    }
}

export default Floors;
